import * as axs from './axs';

export const dpAction = (dp) => async (dispatch, navigate, setLoader) => {
    try{
        const {data} = await axs.dpApi(dp); 
        dispatch ({type: 'DP', data});
        setLoader(false);
        navigate('/Portfolios');
        window.location.reload(true);
    } catch(error) {
        console.log(error);
    }
}
